import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import processImg from '../src/processImg.svg';

function Process() {
  return (
    <Container
      maxWidth="xl"
      style={{
        background: '#F2E7D6',
        position: 'relative',
        paddingBottom: '5%',
      }}
    >
      <Grid
        container
        spacing={4}
        alignContent="flex-end"
        alignItems="flex-end"
        justifyContent="center"
        style={{ position: 'relative' }}
      >
        <Grid item xs={12} sm={8}>
          <h1
            style={{
              fontSize: '3rem',
              fontFamily: 'yeseva one',
              position: 'relative',
              paddingLeft: '10%',
            }}
          >
            The Process
          </h1>
        </Grid>
        <Grid item xs={12} sm={4}>
          <img
            className="my-svg"
            src={processImg}
            height="auto" // Keep the original image height
            style={{ position: 'relative', width: '100%' }} // Make the image responsive in width
            alt="Process Image"
          />
        </Grid>
      </Grid>
      <hr style={{ width: '100%', borderColor: 'black', marginLeft: 0 }} />
      <Grid
        container
        spacing={4}
        alignContent="flex-end"
        alignItems="flex-end"
        justifyContent="center"
      >
        <Grid item xs={12} sm={8}>
          <Box p={0}>
            <p
              style={{
                paddingLeft: '10%',
                lineHeight: '30px',
                fontFamily: 'josefin sans',
                fontSize: '1.5rem',
                position: 'relative',
                width: '100%', // Make text full width on small screens
              }}
            >
              A customer-oriented consulting process. Whatever the challenge,
              time frame, and budget, I can help you on your journey to success.
              A process with the ultimate goal of making you happy.
            </p>
          </Box>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Process;
